INSERT INTO `profil` (`id_profil`, `jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `prov`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
(1, 'SMP', 'SMP Muhammadiyah 1 Yogyakarta', 20403242, '0366/H/1986', '0000-00-00', 'PURWODININGRATAN NG I/902-B', 'NGAMPILAN', 87, 5, 1, '0274 589624', 'smpmuh1yog@gmail.com', 'www.smpmuh1-yog', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 1 Yogyakarta adalah TERWUJUDNYA GENERASI MUSLIM BERKUALITAS,\nUNGGUL DALAM PRESTASI,\n BERWAWASAN IPTEK DAN BERBUDAYA LINGKUNGAN', '1. Meningkatkan pengamalan ajaran Islam dan akhlaqul karimah secara optimal\n2. Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien\n3. Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya\n4. Meningkatkan keterampilan akademik dan nonakademik\n5. Meningkatkan sumber daya peserta didik, pendidik dan tenaga kependidikan\n6. Meningkatkan disiplin dan etos kerja yang tinggi dan pelayanan prima\n7. Menumbuhkan semangat apresiasi seni, olah raga dan iptek pada seluruh warga sekolah\n8. Menjalin kerja sama yang harmonis antarwarga sekolah dan lingkungan terkait\n9. Menumbuhkan sikap pola hidup sehat dan berbudaya lingkungan\n', '1. Meningkatkan keimanan dan ketakwaan Kelada Allah SWT.\n2. Menguasai ilmu pengetahuan dan teknologi yang berwawasan global.\n3. Mengoptimalkan pengembangan diri, jasmani dan rohani.\n4. Menumbuhkan karakter peserta didik.\n5. Membudayakan perilaku hidup sehat, peduli dan berbudaya lingkungan.\n', '', '-77,996', '1,103,578', '77000', '4'),
(2, 'SMP', 'SMP Muhammadiyah 2 Yogyakarta', 20403244, '214/BH', '0000-00-00', 'JL. KAPAS II NO 7/A UMBULHARJO YOGYAKARTA', 'SEMAKI', 90, 5, 1, '0274 564136', 'informasi_mucil@yahoo.co.id', 'www.smpmuh2yk.s', 'A', '21.01/BAP-SM/TU/XII/2013', 'Kurikulum ', 'VISI SMP MUHAMMADIYAH 2 YOGYAKARTA "Terbentuknya manusia muslim, takwa, cerdas, terampil, berwawasan lingkungan dan budaya INSERT INTO `profil` (`id_profil`, `jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `prov`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
(48, 'SMP', 'SMP PUTRATAMA', 20402721, 'E.4/188/PPK/1981', '0000-00-00', 'TEGIRI 2', 'HARGOWILIS', 52, 3, 1, '', '', '', 'C', '19.01/BAP/TU/XII/2007', 'KTSP', '1.membentuk manusia muslim yang taat dan sholeh/ sholekhah   2. meningkatkan peserta didik agar terampil dalam berkarya dan pandai memanfaatkan peluang    3. meningkatkan prestasi peserta didik agar terampil dalam berkarya dan pandai memanfaatkan peluang   4. melaksanakan pembinaan peningkatan ibadah sholat, puasa dan membaca alquran  5. melaksanakan pembelajaran efektif dan efisien   6. melaksanakan kegiatan pengembangan diri   7. melaksanakan pembinaan disiplin dan tanggung jawab', 'Terwujudnya refleksi iman dan taqwa dalam akhlakulkarimah, cerdas, terampil, berbudaya, sehat jasmani dan rohani serta mandiri.', '1. mempunyai perilaku positif atas dasar iman dan taqwa terhadap Tuhan YME. 2. Mempunyai sifat terbuka, kreatif, dan tanggap terhadap kemajuan iptek.   3. mempunyai pola pikir dan emosional yang matang.  4. mempunyai kemampuan berkompetensi dalam bidang ilmu pengetahuan.  5. mampu memecahkan permasalahan kehidupan yang dihadapi     6.  mampu melanjutkan  ke jenjang pendidikan yang lebih tinggi.', '', '-7,823', '1,100,988', '1400', ''),
(49, 'SMP', 'Sekolah / Madrasah DIY', 20402709, '23628/MPK/76', '0000-00-00', 'TLOGOLELO', 'HARGOMULYO', 52, 3, 1, '-', 'smpm3kkp@yahoo.co.id', '-', 'B', '10.01/BAP.SM/TU/XI/2012', 'KTSP', 'Terwujudnya Pelajar MuslimBerakhlak Mulia, Terampil, dan Berprestasi dalam Ilmu Pengetahuan dan Teknologi, Berpedoman Pada Al-Qur an dan Sunnah.', '1.Â Â Â  Mewujudkan insan yang beriman dan bertakwa terhadap Tuhan Yang Maha Esa;', '1. Memenuhi pendidikan yang bermutu, efisien, dan relevan serta daya saing yang tinggi yang berwawasan Islami;', 'Islami, Berprestasi', '-78,681', '1,100,537', '900', '15'),
(50, 'SMP', 'Sekolah / Madrasah DIY', 20402736, '0910/H/1986', '0000-00-00', 'JARAKAN', 'KEBONHARJO', 57, 3, 1, '', 'smpmuh1samigaluh@yahoo.co.id', '', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP ', 'Mewujudkan manusia muslim beriman, bertaqwa, berilmu, sehat jasmani rohani dan unggul dalam NEM', '1. Meningkatkan pengamalan ajaran Islam dan akhlaqul karimah secara optimal, 2. Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien, 3. Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya, 4. Meningkatkan keterampilan akademik dan non akademik, 5. Meningkatkan sumber daya peserta didik, pendidik dan tenaga kependidikan, 6. Meningkatkan disiplin dan etos kerja yang tinggi, 7. Meningkatkan mutu pelayanan, 8. Menumbuhkan semangat apresiasi seni, olahraga dan iptek pada seluruh warga sekolah, 9. Menjalin kerja sama yang harmonis antarwarga sekolah dan lingkungan terkait, 10. Menumbuhkan sikap dan pola hidup berbudaya lingkungan yang sehat, bersih dan nyaman', '1. Meletakan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.', '', '-76.965', '1,101,405', '900', '30'),
