(59, 'SMP', 'Sekolah / Madrasah DIY', 20402732, '0912/H/1986', '0000-00-00', 'SEWUGALUR', 'KARANGSEWU', 50, 3, 1, '81226616114', 'mbsalmanar@gmail.com', 'mbsalmanar.blog', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'Islami, Unggul, Terpilih', '1 Menanamkan nilai-nilai Ke-Islam-an secara komprehensif, sehingga seluruh warga sekolah mampu memahami dan mengamalkan agama Islam secara benar 2 Melaksanakan pembelajaran & bimbingan secara sistemik sistematis, rasional, dan berkesinambungan sehingga setiap siswa dapat berkembang secara optimal, sesuai dengan potensi   yang dimiliki                                                 3 Menumbuhkan semangat keunggulan, kepeloporan, kebersamaan dan kemandirian secara intensif kepada seluruh warga sekolah                                 4 Mendorong dan membantu setiap siswa untuk mengenali potensi dirinya sehingga dapat berkembang secara optimal                                                          5 Meningkatkan dedikasi, komitmen, dan kompetensi bagi tenaga pendidik dan tenaga kependidikan.', '1 Terbentuknya suasana sekolah yang bernuansa Islami yang tercermin dalam tutur kata, perilaku, dan pola pikir seluruh warga sekolah 2.................3...........', '', '-7,929,331', '1,101,719', '900', '150'),
