(61, 'SMK', 'SMK Muhammadiyah II Ngentak', 20402814, '425.11/3481', '0000-00-00', 'KASIHAN II', 'NGENTAKREJO', 53, 3, 1, '6290000000000.0', 'smkmuda_02@yahoo.com', '-', 'B', 'no sk akreditasi', 'KTSP', 'UNGGUL, SANTUN, BERAKHLAK MULIA DAN MAMPU BERKOMPETISI DI DUNIA USAHA/ DUNIA INDUSTRI BERLANDASKAN IMAN DAN TAKWA', '1. Menyelenggarakan proses pembelajaran PAIKEM guna mewujudkan SDM yang berkualitas di bidang akademik dan non akademik. 2. Memberdayagunakan bahasa jawa secara baik dan benar di lingkungan sekolah. 3. Melaksanakan kegiatan Keislamam, Ke-Muhammadiyahan dan Bahasa Arab (ISMUBA) secara konsisten dan berkelanjutan. 4. Memberdayakan potensi alam atau lingkungan dalam menciptakan karya melalui kurikulum berbasis kearifan lokal. 5. Membentuk dan memberdayakan Unit Produksi dan Jasa (UPJ) sebagai wadah untuk memotifasi siswa melaksanakan praktik wirausaha.', '1. Menyiapkan siswa menjadi manusia insan, unggul dan berkarakter. 2. Menyiapkan SDM yang santun dan berakhlak mulia melalui pemberdayaan bahasa jawa yang baik dan benar serta melalui kegiatan pembelajaran ISMUBA. 3 Meniapakan siswa Menjadi tenaga kerja tingkat menengah yag mampu mengembangakan kreatifitas dan memiliki daya beda. 4. Menyiapkan siswa memiliki kompetensi yang relefan dengan kebutuhan dunia kerja, produktif dan inovatif. 5. Memberi bekal pengetahuan kepada siswa yang berkeinginan melanjutkan kejenjang yang lebih tinggi (PerguruanTinggi).', 'MUDA BERKARYA', '-79,004', '1,102,588', '2200 wat', '30'),
