(69, 'SMK', 'SMK Muhammadiyah II Playen ', 20402132, '018/I13/H/Kpts/1988', '0000-00-00', 'Jl. Manthous Km 1 Jatisari, Playen, Gunungkidul, Y', 'JATISARI', 26, 2, 1, '0274 392504', 'smkmuha2playen@gmail.com', 'www.smkmuha2pla', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'TERWUJUDNYA KADER MUSLIM YANG BERTAQWA, BERAKHLAK MULIA, ULET DAN MEMILIKI ETOS KERJA TINGGI', '1) Membangun Budaya Islami di Sekolah. 2) Membangun Budaya Tertib dan Disiplin di Sekolah. 3) Membangun Budaya Positif di Sekolah. 4) Memperkuat Manajemen Berbasis Sekolah dan Masyarakat. 5) Membangun Budaya Industry di Sekolah.', '1) Menyiapkan kader muslim agar menjadi warga Negara yang bertaqwa dan berakhlak mulia. 2) Menyiapkan kader muslim untuk bekerja mandiri atau sebagai tenaga kerja tingkat menengah untuk mengisi lowongan pekerjaan di Dunia Usaha / Dunia Industri. 3) Menyiapkan kader muslim agar menjadi warga Negara yang adaptif, kreatif, produktif dan santun. 4) Menyiapkan kader muslim menjadi warga negara yang berbudaya lingkungan. 5) Menyiapkan kader muslim yang mampu memilih karir, mampu berkompetisi dan mempu mengembangkan diri.', 'SMK MUDA, ISLAMI, BERBUDI, BERPRESTASI', '-79,453', '1,105,573', '22500', '5'),
(70, 'SMK', 'SMK Muhammadiyah Karangmojo ', 20402131, '3207/N.602/DIY.68/77', '0000-00-00', 'JL. KARANGMOJO-PONJONG KM.0,5', 'KARANGMOJO', 20, 2, 1, '0274 391939', 'smkmuhkarangmojo@yahoo.co.id', 'smkmuhkarangmoj', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'Terwujudnya lulusan yang unggul dan islami', '1. Terlaksananya pembelajaran berbasis sains dan teknologi, 2. Terciptanya budaya belajar yang menyenangkan, 3. Terciptanya tradisi islami disekolah dan masyarakat, 4. Tersedianya lulusan yang mandiri, kreatif dan kompetitif', '1. Mencetak lulusan siap kerja di industri dan wirausaha yang profesional,handal berakhlak mulia. Untuk mlanjutkan kuliah juga bisa.', 'SantunÂ Mandiri dan berprestasiÂ AgamisÂ Rela berkorbanÂ Tegar', '-79533', '1,103,491', '25000', '7'),
(71, 'SMK', 'SMK Muhammadiya I Patuk', 20402134, '0146/II3/MN/Kpts/199', '0000-00-00', 'JL. Yogya Wonosari Km. 23, 7, Putat, Patuk, Gunung', 'PUTAT', 25, 2, 1, '85868225111', 'smk_muh1patuk@yahoo.co.id', 'www.....', 'B', '21.01/BAP-SM/TV/XII/2013', 'KTSP ', 'Menjadi Sekolah unggulan dalam menyiapkan tenaga kerja dan wirausaha baik tingkat lokal, nasional, maupun global yang dilandasi keimanan, ketaqwaan terhadap Allah SWT.', '1. Menyelenggarakan pendidikan dan pelatihan sesuai standar pemerintah dan persyarikatan Muhammadiyah.                  2. Memberi nilai-nilai tambahan sesuai peluang/ pasar baik lokal, nasional, maupun global.                                               3. membuka cakrawala untuk siswa dapat melihat peluang dan berkembang mengikuti tuntutan dnia kerja/ industri.                  4. meningkatkan keunggulan kompetitif dalam bidang Teknik Informatika, Akuntansi, Teknik Otomotif Sepeda Motor dan Teknik Audio Video.                                                                             5. Menyiapkan kerjasama dengan DU/DI.                                                                          6. Mencetak kader Muhammadiyah yang cakap dan berakhlaklul kharimah.', '1.Menyiapkan teaga yang siap pakai, melalui pendidikan yang terstandar, kerjasama dengan DU/DI dan pemberian nilai tambah berupa penguasaan TI dan Bahasa Inggris                                   2. Menghasilkan lulusan dengan kompetensi yang sesuai dengan standar pemerintah, masyarakat Muhammadiyah, tuntutan pasar lokal, nasional, maupun global, mamp berwirausaha secara mandiri serta siap untuk terus mengembangkan diri secara otodidak, belajar dalam komunitas/ rekan profesi ataupun study lanjut d Perguruan Tinggi.', 'Cerdas, Terampil, Berakhlaq Mulia', '-78,693', '1,105,197', '9000', '4Mbps'),
(72, 'SMK', 'SMK Muhammadiyah II Ponjong', 20407419, '1299/I.4/B/2012', '0000-00-00', 'JL. SIMPANG LIMA', 'GENJAHAN', 24, 2, 1, '81804028220', 'smkmuhduaponjong@gmail.com', 'www.....', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'Unggul di bidang Multimedia dan Otomotif berdasarkan Iman dan Taqwa', '1. menumbuhkan kondisi belajar yang kondusif dalam mencetak insan yang cerdas dan kompetitif di bidang Multimedia dan Otomotif 2. Mendorong kegiatan pengembangan diri secara optimal 3.mengembangkan budaya disiplin dan jiwa kewirausahaan 4. menumbuhkan kindisi sekolah yang Islami dan mendorong ketaatan menjalnkan ibadah', '1.............2.................3...........', '', '-79,023', '1,103,491', '15000', '30'),
(73, 'SMK', 'SMK muhammadiyah Semin', 20402130, '0277/H/1986', '0000-00-00', 'Jln. Alun-alun Pundungsari, Semin, Semin, Gunungki', 'SEMIN', 32, 2, 1, '0274 367954', 'smkmuhsemi@gmail.com', 'www.....', 'A', '22.01/BAPSM/TU/X/2015', 'KTSP', 'Terwujudnya Kader Muhammadiyah yang bertaqwa dan berakhlak mulia, siap bekerja propesional, mandiri dan berbudaya lingkungan', '1. Membangun budaya islami disekolah', '1. Menyiapkan Kader Muhammadiyah agar menjadi warga negara yang bertaqwa dan berakhlak mulia', '', '-79,023', '1,103,491', '15000', '30'),
(74, 'SMK', 'SMK Muhammadiyah Tepus', 20402129, '004/II.3/MN/KPTs/97', '0000-00-00', 'PRIGI,SIDOHARJO,TEPUS', 'SIDOHARJO', 34, 2, 1, '87739714680', 'smkmuhtepus@yahoo.com', 'http://www.smkm', '', 'A', 'KTSP ', 'MEWUJUDKAN LULUSAN YANG ISLAMI , SIAP BEKERJA , UNGUL DALAM PRESTASI', '1. MENGEMBANGKAN BUDAYA ISLAMI DI SEKOLAH 2. MEMBANGUN BUDAYA KEWIRAUSAHAAN DI SEKOLAH 3. MEMBANGUN BUDAYA INDUSTRI DI SEKOAH 4. MENGEMBANGKAN DIKLAT BERORIENTASI KEBUTUHAN PASAR KERJA ( DU/DI ) 5. MEMBANGUN JEJARING KERJASAMA DENGAN DU/DI 6. MELAKSANAKAN KBM YANG BERKUALITAS', '1. MENYIAPKAN SISWA MENJADI MANUSIA YANG BERTAQWA BERAKLAK MULIA CINTA TANAH AIR DAN LOYAL TERHADAP MUHAMADIYAH 2. MENYIAPKAN SISWA MENJADI TENAGA KERJA TINGKAT MENENGAH UNTUK MENGISI KEBUTUHAN DU/DI 3. MENYIAPKAN SISWA MENJADI WIRAUSAHAWAN BARU 4. MENYIAPKAN SISWA YANG BERPRESTASI BAIK AKADEMIK MAUPUN NON AKADEMIK', 'ISLAMI SIAP KERJA DAN KOMPETITIF', '-80,782', '1,106,247', '1500', '4'),
(75, 'SMK', 'SMK Muhammadiyah 1 Ngawen', 20407359, '1354/I.4/B/2016', '0000-00-00', 'Komplek Masjid Kota Kec. Ngawen Gunungkidul', 'KAMPUNG', 21, 2, 1, '85293393460', 'smkmuh1ngawen@gmail.com', '', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Terwujud Sumber Daya Manusia yang bertaqwa, berakhlak mulia dan memiliki Intelektual, Ketrampilan, Kemandirian, Profesional, serta siap memasuki dunia industri', '1. Membentuk manusia yang memiliki Iman dan taqwa yang kuat dan berakhlakul karimah.', '1. Meningkatkan pengamalan agama Islam sesuai dengan ajaran Muhammadiyah (Al Qur''an dan Sunnah).', '', '-78,374', '1,107,009', '5000', '2'),
(76, 'SMK', 'SMK Muhammadiyah Kaarangwuni', 20407434, '4048/II-208/DIY-82/1', '0000-00-00', 'RT 03,  RW 01, KERDONMIRI', 'KARANGWUNI', 29, 2, 1, '85229783335', 'smkmuhiro@gmail.com', 'www.....', 'B', 'no sk akreditasi', 'KTSP ', 'Terwujudnya sekolah yang bermutu dalam IPTEk dan IMTAQ dengan mengedepankan akhlaq yang mulia', '1. Menyelenggarakan kegiatan pmbelajaran secara efektif.                      2. Memanfaatkan hasil - hasil teknologi dalam kegiatan pembelajaran.                3. Menumbuhkan semangat keunggulan jiwa mandiri, kompetensi sehat,tanggung jawab dan kepedulian sekolah.                4. Menggiatkan aktifitas keagamaan di lingkungan sekolah dan masyarakat.       5. Memberikan pendidikan dan pelatihan ketrampilan / kecakapan hidup di bidang teknologi, sehingga siswa memiliki kompetensi tinggi mampu bersaing dipasar kerja.', '1.............2.................3...........', '', '-80.762', '1,107,632', '2300', '6'),
(77, 'MTS', 'MTS MUHAMMADIYAH NGAWEN ', 20411959, 'E-4/216/XI/1979', '0000-00-00', 'Kampungkidul RT 03 RW 02, Komplek Masjid Besar Kec', 'KAMPUNG ', 21, 2, 1, '81804251911', 'mtsmuhngawen@yahoo.co.id', 'www.....', 'B', 'Dp.011972', 'KTSP dan K', 'Terciptanya Suasana Islami dan Berakhlaqul Karimah, Unggul dalam Prestasi dean Berwawasan IPTEK', '1)Meningkatkan pengamalan ajaran Islam dan akhlaqul karimah dalam kehidupan sehari hari  2)Meningkatkan pelaksanaan pembelajaran dan bimbingan secara effektif, komprehensif dan integralistik  3)Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya 4)Meningkatkan ketrampilan akademik dan non akademik  5)Meningkatkan sumber daya peserta didik, pendidik dan tenaga kependidikan 6)Meningkatkan disiplin, etos kerja yang tinggi dan pelayanan prima 7)Menerapkan penguasaan IPTEK dengan melibatkan seluruh warga sekolah 8)Menjalin kerjasama yang harmonis antar warga madrasah dan lingkungan terkait 9)Mengembangkan potensi seluruh warga sekolah untuk mencapai keunggulan dalam kegiatan pembelajaran', '1.............2.................3...........', '', '110,700,943', '-7,837,409', '1300', '54'),
(78, 'MTS', 'MTS MUHAMMADIYAH POJONG', 20411973, 'E-4/215/XI/1979', '0000-00-00', 'PADANGAN', 'PONJONG', 27, 2, 1, '081 704 286 50', 'mtsmuhammadiyahponjong@yahoo.c', '', 'B', '28.2/BAP/TU/X/2011', 'KTSP dan K', 'visi misi sekolah MTS Muhammadiyah Ponjong adalah Membentuk tamatan yang berakhlak mulia dan berprestasi.', '1. Meningkatkan penghayatan dan pengamalan ajaran Agama Islam. 2.Membudayakan perilaku agama dalam kehidupan sehari-hari 3.Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien. 4.Menyiapkan siswa untuk masuk ke jenjang sekolah yang lebih tinggi dengan nilai UN yang memuaskan. 5.Mewujudkan hubungan dengan masyarakat dengan memfungsikan komite Madrasah demi meningkatkan kualitas pendidikan', '1.Membekali siswa dengan ajaran Agama Islam. 2.Membiasakan diri mengamalkan ajaran Agama Islam dan berakhlakul karimah. 3.Meningkatkan prestasi akademik maupun non akademik. 4.Tercapainya perolehan nilai UN dan UMAD lebih dari 7.00. 5.Terciptanya hubungan yang harmonis dan saling memberikan kontribusi antara Madrasah, Komite, dan Masyarakat.', 'Berakhlak dan Berprestasi', '-7,984,539', '11,071,353', '1300', '128'),
(79, 'MTS', 'MTS MUHAMMADIYAH SEMANU', 20411978, '4.579/II-191/DIY-94/', '0000-00-00', 'KOMPLEKS MASJID MUJAHIDIN', 'SEMANU', 31, 2, 1, '', 'mts_muhsemanu@yahoo.co.id', '', 'A', '28.2/BAP/TU/X/2011', 'KTSP dan K', 'TERWUJUDNYA INSAN YANG BERAKHLAK MULIA SESUAI TUNTUNAN ISLAM, BERPRESTASI, UNGGUL, DAN MEMILIKI KECAKAPAN HIDUP', '1. Membiasakan perilaku sesuai ajaran Islam dalam kehidupan sehari-hari, 2. Memotivasi dan meningkatkan pembelajaran siswa agar berprestasi, 3. Menumbuhkembangkan bakat dan minat siswa secara optimal, 4. Membekali siswa dengan keterampilan melalui kegiatan intrakurikuler dan ekstrakurikuler.', '1. Semua warga madrasah dapat menjalani hidup sesuai dengan syariat Islam seperti yang dicontohkan oleh Nabi Muhammad SAW, 2. Siswa dapat berprestasi baik dibidang akademik maupun non akademik, 3. Bakat dan minat siswa berkembang dengan baik sehingga memiliki bekal hidup untuk meraih masa depan yang gemilang, 4. Siswa dapat melanjutkan ke jenjang lebih tinggi dan memiliki keterampilan hidup.', 'Berakhlak Mulia, Tekun Beribadah, Berprestasi', '110,648,028', '-778,013', '1300', '0'),
(80, 'MTS', 'MTS MUHAMMADIYAH SODO', 20411963, '56/MTs/GK/86', '0000-00-00', 'JALAN KI AGENG GIRING', 'SODO', 23, 2, 1, '81904228426', 'mtsmuhammadiyahsodo@yahoo.co.i', '0', 'A', '12.1/BAP/TU/XI/2010', 'KTSP dan K', 'Islami, Berprestasi, dan Berbudaya Positif', '1. Memupuk dan memelihara keimanan dan ketaqwaan melalui rutinitas tadarus Al Qur an, shalat wajib dan shalat sunah 2. Menjadikan para siswa aktif dalam belajar dan berlatih untuk mencapai prestasi dan berketrampilan serta kemampuan yang maksimal.  3. Membiasakan warga madrasah selalu menjunjung tinggi nilai budaya dengan menghargai kreasi cipta karya siswa  dan guru / karyawan.', 'Memiliki lulusan madrasah yang unggul dalam menjalankan syariat islam, berprestasi dalam bidang akademik serta mampu menjunjung nilai- nilai budaya yang positif', 'MASAMUDO Santun dan Berwibawa', '-8,002,608', '110,560,878', '2200', '1'),
(81, 'SMP', 'SMP Muhammadiyah 2 Gedangsari ', 20401973, '203/SP/P/U/LK/79', '0000-00-00', 'Jln. Mertelu, Gedangsari, Gunungkidul', 'MERTELU', 18, 2, 1, '81328497397', 'Email sekolah', 'www.....', 'B', '25/BAS/DIY/4/09', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Gedangsari adalah : Berprestasi, berwawasan IPTEk berlandaskan Imtaq', '1Menumbuhkan motivasi untuk mendalami,menghayati dan mengamalkan ajaran agama islam dalam kehidupan sehari-hari, 2 melaksanakan PBM yang efektif dan intensif. 3 mensosialisasikan dan menumbuhkan semangat bersaing. 4 memberikan ketrampilan komputer. 5 memberikan ekstrakurikuler BTA. 6 Menciptakan pelayanan prima terhadap siswa,orang tua dan masyarakat. 7 menerapkan manajemen partisipatif dengan melibatkan seluruh warga sekolah sehingga menjadi team work yang solid.', '1 rata-rata peningkataan nilai ujian nasioanl + 0.5 2.jumlah lulusan diterima di SMK/SMA mencapai 30 % 3. 60 % siswa mampu melaksanakan ibadah dengan tekun dan benar 4. 60% siswa mampu membaca al-qur''an dan doa sehari-hari 5.50% siswa mampu mengoperasikan komputer 6.25 % ruang kelas dilengkapi LCD sebagai media pembelajaran di kelas 7.terbangunnya data base profil sekolah 8.terpenuhinya sarana dan prasarana sekolah 9.terpenuhinya tambahan ruang belajar baru 10.memiliki lingkungan yang tertib,bersih,nyaman aman dan kondusif', '', '-78,344', '1,106,051', '2200', '2'),
(82, 'SMP', 'SMP MUHAMMADIYAH 1 NGLIPAR', 20401977, 'E-1/58/K/GK/1983', '0000-00-00', 'JL.WOTGALIH', 'PILANGREJO', 22, 2, 1, '', 'smpmuhammadiyah1nglipar@gmail.', 'www.....', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP 2006', 'Berkembangnya potensi siswa menjadi pribadi yang unggul dalam iman dan taqwa, ilmu pengetahuan dan teknologi, terampil dan mandiri serta berakhlak mulia.', '1. Melaksanakan PBM yang konduktif', '1. Terbentuknya manusia yang beriman dan bertaqwa serta berahlak mulia', '', '-78.572', '1,106,476', '900', '30'),
(83, 'SMP', 'SMP MUHAMMADIYAH 2 NGLIPAR', 20401981, '0277/H/1986', '0000-00-00', 'JL.BINA KOTA , NGLIPAR', 'NGLIPAR', 22, 2, 1, '', 'smpmuh2nglipar@gmail.com', 'www.....', 'A', '16.01/BAP/SM/TU/X/2014', 'KTSP 2006', 'BERKEMNGNYA POTENSI SISWA MENJADI PRIBADI YANG TAQWA, BERPRESTASI DAN TERAMPIL', '1.MELAKSANAKAN PBM YANG EFEKTIF DAN KONDUKTIF', '1. TERBENTUKNYA MANUSIA YANG BERBUDI LUHUR, BERTAQWA SERTA BERAKHLAK MULIA,', '', '-79,023', '1,106,161', '2200', '30'),
(84, 'SMP', 'SMP MUHAMMADIYAH 1 PALIYAN', 20401974, '3202/M.675/DIY.74/77', '0000-00-00', 'GROGOL', 'GROGOL', 23, 2, 1, '6280000000000.0', 'smpmuhammadiyah1paliyan@gmail.', '', 'B', '04.03.017.09', 'KTSP', 'mulia dalam akhlak, berprestasi, berwawasan iptek, berlandaskan imtaq, dan peduli lingkungan', '1. meningkatkan keimanan dan ketakwaan terhadap Tuhan Yang Maha Esa; 2. menumbukan penghayatan teradap agama dan budaya bangsa sehingga menjadi sumber kearifan dalam bertindak; 3. menumbuhkan akhlak mulia (budi pekerti luhur); 4. melaksanakan PBM yang efektif dan intensif untuk mengoptimalkan potensi siswa; 5. meningkatkan prestasi akademik dan non akademik; 6. meningkatkan mutu lulusan; 7. mengembangkan kemampuan bidang olahraga; 8. meningkatkan kualitas lingkungan yang indah, bersih, nyaman, dan aman', '1. sekolah mampu melaksanakan program baca tulis Al-Quran (TPA/BTA) oleh siswa yang beragama Islam; 2. sekolah mampu melaksanakan berbagai program kegiatan keagamaan seperti: pembiasaan sholat dhuha, sholat dhuhur berjamaah, sholat Jum''at berjamaah, Pesantren Kilat,/Ramadhan, dan pringatan hari besar keagamaan; 3. sekolah mampu melaksanakan program 5 S (salam, salim, senum, sapa, dan santun) dalam rangka menumbuhkan akhlak mulia; 4. sekolah mampu melaksanakan pembelajaran aktif inovatif kreaif dan menyenangkan; 5. sekolah mampu mencapai tingkat kelulusan 100% dengan rata-rata nilai ujian 6,0; 6. sekolah mampu meningkatkan persentase lulusan yang diterima di sekolah negeri (SMA/SMK/MA) sekurang-kurangnya 90% dari lulusan; 7. sekolah mampu melaksanakan kegiatan pengembangan diri/ eksra kurikuler secara efektif guna melaksanakan pengembangan bakat siswa; 8. sekolah mampu melaksanakan berbagai kegiatan lomba antar warga sekolah; 9. sekolah mampu melakukan berbagai kegiatan penataan dan pembersihan lingkungan; 10. sekolah mampu mengelola sampah di sekolah menjadi lebih bermanfaat.', '', '-8', '111', '2200', '3'),
(85, 'SMP', 'SMP MUHAMMADIYAH 2 PALIYAN', 20401980, '3195/M.668/DIY.75/77', '0000-00-00', 'Jl.Paliyan - Playen, karangduwet, Paliyan, Gunungk', 'KARANGDUWET', 23, 2, 1, '81227099580', 'semmudapaliyan@yahoo.co.id', '', 'A', '16.01/BAP.SM/TU/X/2014', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Paliyan adalah TERWUJUDNYA SEKOLAH YANG MENGHASILKAN LULUSAN BERIMAN, BERPRESTASI, DAN MANDIRI INSERT INTO `profil` (`id_profil`, `jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `prov`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
(101, 'SMA ', 'SMA Muhammadiyah Tirtomartani', 20401147, '3663/II.162/DIY.yg/1', '0000-00-00', 'DHURI Jln. LPMP', 'TIRTOMARTANI', 66, 4, 1, '81328185995', 'smamuhika@yahoo.com', 'wwwsmamuhammadi', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'ISLAMI,UNGGUL DALAM PRESTASI DAN KOMPETITIF', '1.Menumbuhkan kesadaran untuk menghayati nilai-nilai ajaran islam dan nilai-nilai kebangsaan,sehingga siswa dapat menjadi manusia Indonesia seutuhnya , 2.menjadikan lembaga pendidikan berskala nasional yang unggul dalam prestasi3.Menjadikan anak didik yang sholeh menguasai ilmu pengetahuan dan teknologi diatas landasan iman dan tagwa yang kokoh,sehingga menjadi insan yang mandiri, berwawasan luas, sadar akan keberadaannya dan bermanfaat bagi masyarakat Indonesia yang majemuk, ikhas dan bersungguh-sungguh dalam melaksanakan tugas amar makruf nahi munkar,4. Menjadi tempat bagi karyawan,guru dan kepala sekolah untuk kepentingan, kesejahteraan bersama dan mewujudkan kepentingan profesional, 5.Menjadi tempat bagi insan untuk berprestasi,berkreasi dan mengembangkan diri, 6. Menjadi aset pendidikan nasional yang mencetak manusi unggul,berbudi pekerti yang luhur serta menjadi kebanggaan umat islam dan masyarakat secara luas.', '1.Meningkatkan prestasi akademik dan non akademik melalui pencapaian nilai ujian akhir dan prestasi di bidang lain (keagamaan,kesenian,olahraga, dan karya ilmiah remaja),2. Mengembangkan kedisiplinan dari seluruh komponen sekolah untuk membentuk kepribadian yang tangguh dan kokoh sebagai dasar setiap aktifitas serta sebagai aset sekolah, 3.Meningkatkan penghayatan dan pengamalan terhadap ajaran agama, 4.Meningkatkan kemampuan siswa dalam       pemanfaatan teknologi informatika khususnya komputer, mengakses internet dan pemprograman komputer, 5.Meningkatkan aktifitas kreatifitas siswa melalui pelaksanaan kegiatan intrakulikuler dan ekstrakulikuler', 'Berprestasi tinggi, Islami dan berakhlak mulia.', '-77,574,713', '1,104,782,547', '2300', ''),
(102, 'SMA ', 'SMA Muhammmadiyah Pakem', 20401169, '4379/II-193/DIY-78/1', '0000-00-00', 'Jl. Kaliurang Km. 17 Pakemtegal Pakembinangun Pake', 'PAKEMBINANGUN', 72, 4, 1, '0274- 895545', 'sma_muhammadiyah_pakem@yahoo.c', '0', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP', '"Terwujutnya lulusan yang menguasai IMTEK dan IMTAQ, berakhlak mulia, peduli terhadap keunggulan lokal, dan mampu berperan sosial di masyarakat"', '1. Menumbuhkan budaya hidup islami di sekolah,                                                                                                                                         2. Meningkatkan profesionalitas pendidik dan tenaga kependidikan di sekolah guna menyiapkan lulusan yang berkualitas,               3. Meningkatkan penguasaan IMTEK pada siswa, guru, dan karyawan dengan memberdayakan fasilitas yang dimiliki,                        4. Membekali Pendidikan Berbasis Keunggulan Lokal ( PKBL ) bernuasa kepariwisataan kepada siswa melalui pengintegrasian pada mata pelajaran yang relevan, muatan lokal, pengembangan diri berupa kegiatan Corp Dakwah Pelajar ( CDP ), olahraga prestasi dan rekreasi , seni musik islami, tata busana dan kegiatan komputer desain grafis.', '1. Terwujudnya budaya / kultur sekolah yang islami     2. Tercapainya target akademis ( Rata rata Nim naik 0, 25 ) dan nonakademis ( menjuarai lomba - lomba non akademis ).                                                                         3. Meningkatnya siswa yang melanjutkan ke PT ( 80% ke 90 % )                                                                                4. Terpenuhinya 8 SNP                                                      5. Terwujudnya warga sekolah yang memiliki karakter berbangsa dan bernegara.', 'Kampus Islami Banyak Prestasi', '-76,667', '110,421', 'PLN (440', '20'),
(103, 'SMP', 'SMP MUHAMMADIYAH BREBAH', 20401057, '0175/H/1986', '0000-00-00', 'JL. Kopral Samiyo', 'TEGALTIRTO', 61, 4, 1, '0274 4435253', 'smpmuhberbah@yahoo.com', 'www.....', 'A', '16.1/BAP.SMP/TU/X/2014', 'KTSP ', 'Visi SMP Muhammadiyah 1 Berbah  " Sekolah Islami berwawasan Iptek Berbudaya dan Ramah Lingkungan"', '1. Menumbuhkan penghayatan terhadap ajaran agama Islam dan budaya bangsa sehingga menjadi sumber kearifan dalam bertindak.', '1. Tujuan pendidikan dasar adalah meletakkan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta ketram[ilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.', '', '-78,047', '1,104,513', '2300', '40'),
(104, 'SMP', 'SMP MUHAMMADIYAH 1 DEPOK', 20401013, 'No.3064/M.634/DIY.68', '0000-00-00', 'JL. Stan, Rt.04/Rw. 44, Maguwoharjo, Depok ,Sleman', 'MAGUWOHARJO', 63, 4, 1, '(0274) 4462392', 'smpmusade1968@gmail.com', 'www.smpmuh1depo', 'A', 'No.5.01/BAP-SM/TU/XI/2016', 'KTSP', 'Terwujudnya insan yang berakhlak mulia, mandiri, kreatif, berprestasi, dan berwawasan global', '1.membentuk jati diri kepribadian siswa yang berkarakter keislaman dan kemuhammadiyahan, 2.menghantarkan potensi bakat dan minat secara optimal dan komprehensif dalam meraih prestasi akademik dan non akademik,3.melaksanakan pengembangan pendidik dan tenaga kependidikan yang profesional, 4. melaksanakan pengembangan pembelajaran aktif dan efektif, 5. melaksanakan pengembangan lulusan yang berkualitas, berkepribadian, tangguh, dan berbudaya, 6. melaksanakan pengembangan fasilitas pendidikan yang memadai dan inovatif, 7. melaksanakan pengembangan kelembagaan dan manajemen sekolah yang komprehensif, 8. melaksanakan pembiayaan pendidikan dengan prinsip keadilan dan akuntabel, 9. melaksanakan pengembangan sistem penilaian yang terencana dan berkala, 10. melaksanakan pengembangan penataan lingkungan, budaya sekolah yang kondusif, dan mitigasi bencana', '1.membentuk jati diri kepribadian siswa yang berkarakter keislaman dan kemuhammadiyahan, 2.menghantarkan potensi bakat dan minat secara optimal dan komprehensif dalam meraih prestasi akademik dan non akademik,3.melaksanakan pengembangan pendidik dan tenaga kependidikan yang profesional, 4. melaksanakan pengembangan pembelajaran aktif dan efektif, 5. melaksanakan pengembangan lulusan yang berkualitas, berkepribadian, tangguh, dan berbudaya, 6. melaksanakan pengembangan fasilitas pendidikan yang memadai dan inovatif, 7. melaksanakan pengembangan kelembagaan dan manajemen sekolah yang komprehensif, 8. melaksanakan pembiayaan pendidikan dengan prinsip keadilan dan akuntabel, 9. melaksanakan pengembangan sistem penilaian yang terencana dan berkala, 10. melaksanakan pengembangan penataan lingkungan, budaya sekolah yang kondusif, dan mitigasi bencana', 'Man Jadda wa Jadda...', '-7,763,700', '110,426,200', '7000', '5'),
(105, 'SMP', 'SMP MUHAMMADIYAH 1 GODEAN ', 20401056, '0277/H/1986', '0000-00-00', 'Pirak, Jln Suparjo Km.1', 'SIDOLUHUR', 65, 4, 1, '0274 798040', 'smpmuh1godean@yahoo.co.id', 'www.smpmuh1gode', 'A', '5.01/BAB-SM/TU/XI/2016', 'KTSP', 'Terbentuknya peserta didik yang berakhlak mulia cerdas terampil berprestasi berbudaya dan cinta tanah air', '1. Melaksanakan pembelajaran yang aktif, inovatif dan menyenangkan dengan memaksimalkan media pembelajaran, 2. Meningkatkan keaktian didalam beragama Islam sesuai Al-Qur''an dan Saunah Nabi., 3. Menggali potensi akademik dan non akademik untuk mewujudkan dan meningkatkan prestasi siswa., 4. Antusias terhadap perkembangan dan kemajuan ilmu poengetahuan, teknologi informasi dan komunikasi., 5. Menumbuh kembangkan budaya yang berkarakter, cinta kebersihan, keindahan dan cinta tanah air', '1. Perolehan nilai ujian nasional selalu mengalami kenaikan., 2. Siswa aktif beribadah sholat wajib, sholat sunah dan terbiasa kulyum., 3. Siswa  bisa membaca Al-Qur''an dengan tjwid yang benar., 4. Terwujudnya suasana pergaulan sehari-hari yang berlandaskan keimanan dan ketaqwaan.,  5. Terwujudnya disiplin yang tinggi dari seluruh warga sekolah., 6. Memiliki kegiatan ekstra kurikuler yang maju dan berprestasi di segala bidang,. 7. Siswa bisa memanfaatkan kemajuan teknologi informasi dan komunikasi dengan baik., 8. Terwujudnya menajemen sekolah yang transparan dan partipasif seluruh warga sekolah., 9. Terwujudnya lingkungan sekolah yang bersih, indah dan nyaman., 10. Terwujudnya budaya dan karakter yang baik serta cinta tanah air.', '', '-7,774,497', '110,285,459', '7000', '1'),
(106, 'SMP', 'SMP MUHAMMADIYAH 2 GODEAN', 20404132, '183/Sp/p/U/IK/1979', '0000-00-00', 'Sembuh Lor', 'SIDOMULYO', 65, 4, 1, '0274-6496191', 'smp_muh2gdn@yahoo.com', 'www.smpmuhammad', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP', '', '1.................., 2.........................3...............', '1.............2.................3...........', '', '-77,815', '1,103,116', '4400', '30'),
(107, 'SMP', 'SMP MUHAMMADIYAH KALASAN', 20401017, '3047/M.617/014.55/77', '0000-00-00', 'Glondong, Titomartani, Kalasan, Sleman, DIY', 'TIRTOMARTANI', 66, 4, 1, '0274 367954', 'Email sekolah', 'www.smpmuh1kala', 'A', '', 'KTSP', '1. Memperkukuah landasan ketaqwaan yang dijiwai amal marif nahi munkar dengan berdasarkan Al-Qur an dan AsSunnah, 2. Mengembangkan kepribadain sopan, santun, ramah dalam keluarga, sekolah dan lingkungan masyarakat. 3. Membangun semangat mandiri dengan bekal ketrampilan yang dihandalkan. 4. Mengembangkan kompetensi meraih pretasi serta bertanggung jawab. 5. Mengembangkan sikap hemat, cermat, tekun dalam bertindak dalam segala bidang. 6. Mengembangkan budaya lingkungan sekolah, keluarga dan masyarakat yang bersih, indah dan sehat. 7. Membangun budaya etika berlalu lintas di keluarga, sekolah dan masyarakat.', 'Bertaqwa, Berprestasi, Berbudaya', '1. Mencapai tujuan pendidikan Muahammadiyah, 2. Membentuk calon kader persyarikatan, 3. Membentuk generasi penerus bangsa yang handal, cerdas, beriman dan tawakal berguna bagi orang tua, masyarakat dan negara, 4. Menengkatnya Pelaksan aan Pembelajaran Pendekatan INSERT INTO `provinsi` (`id_provinsi`, `nama`) VALUES
