(17, 'SMK', 'SMK Muhammadiyah Imogiri', 20400453, '055/I.13/4/KPTS/89', '0000-00-00', 'Garjoyo Imogiri Bantul 55782', 'IMOGIRI', 4, 1, 1, '0274 6460876 / ', 'smkmuhammadiyahimogiri@gmail.c', 'www.smkmuh1imog', 'A', '16.01/BAP-SM/TU/XI/2016', 'KTSP ', 'Terwujudnya Insan Islami, Unggul dan Kompetitif', '1. Profesional dalam penyelenggaraan layanan pendidikan.', '1. Menyiapkan peserta didik untuk mewujudkan tujuan pendidikan Muhammadiyah', 'Terwujudnya Insan Islami, Unggul dan Kompetitif', 'E 110,37842', 'S 7,91845', '29700', '30'),
(18, 'SMK', 'SMK Muhammadiyah Kretek', 20400452, '0289/III.A/1D/2000', '0000-00-00', 'JL. PARANGTRITIS KM.22, TEGALSARI', 'DONOTIRTO', 2, 1, 1, '8112651590', 'smk.kretek@yahoo.com', 'www.smkmkretek.', 'A', '4442/II-02/DIY-89/1990', 'KTSP ', 'Mencetak generasi terampil, berkarakter dan berakhlak mulia', '1.Memberikan bekal pada berbagai jenis pekerjaan sejalan dengan perkembangan ilmu pengetahuan, teknologi, dan tuntutan dunia kerja., 2. Menumbuh kembangkan nilai-nilai karakter pada proses pembelajaran dan pada semua kegiatan peserta didik. 3. Menanamkan nilai-nilai islami dan akhlak ulkarimah pada setiap perikehidupan peserta didik.', '1. Mampu menyerap dan mengembangkan ilmu yang didapat dalam proses pembelajaran. 2. Mampu mengembangkan potensi yang dimiliki sebagai wujud prestasi belajar untuk mencapai cita   citanya demi masa depan. 3. Mampu mengembangkan jiwa seni dan keindahan yang dimiliki oleh masing masing siswa.', 'Generasi berilmu akan menciptakan bangsa yang cerdas', '-79,023', '1,103,491', '3500', '1'),
(19, 'SMK', 'SMK Muhammadiyah Piyungan', 20400451, '044/113/H/KPTS/89', '0000-00-00', 'Pelemsari', 'SRIMARTANI', 14, 1, 1, '0274 4537182', 'smkmuhammadiyahpiyungan@yahoo.', '-', 'A', '10.01//BAP-SM/TU/XI/2012', 'KTSP', 'Bertaqwa, berbudaya, percaya diri, profesional dan kompetitif di era global.', '1. Profesional dalam penyelenggaraan layanan pendidikan, 2. Mengembangkan keharmonisan jasmani, rohani, intelektual, emosional dan sosial, 3. Menumbuhkembangkan', '1.Menyiapkan peserta didik untuk dapat mewujudkan tujuan pendidikan Muhammadiyah, 2. Menyiapkan peserta didik agar menjadi manusia produktif, mampun bekerja mandiri, mengisi lowongan pekerjaan yang ada di DU/DI sebagai tenaga kerja tingkat menengah sesuai dengan kompetensi pada program keahlian yang dipilihnya, 3. Menyiapkan peserta didik agar memiliki sikap profesional dan memiliki jiwa kewirausahaan (enterpreunership), 4. Menyiapkan peserta didik agar mampu memilih karier, ulet dan gigih dalam berkompetensi, 5. Menyiapkan peserta didik dengan ilmu pengetahuan, teknologi dan seni agar mampu mengembangkan diri di kemudian hari baik secara mandiri maupun melalui jenjang pendidikan yang lebih tinggi, 6. Membekali peserta didik dengan kompetensi-kompetensi yang sesuai dengan program keahlian yang dipilih sehingga mampu menciptakan pekerjaan sendiri.', '', '7.4932.60', '110.2908.90', '6200', '03.08'),
(20, 'SMK', 'SMK Muhammadiyah Bangunjiwo', 69775326, '421/068', '0000-00-00', 'JL. KALIRANDU, PELEMAN RT 04', 'BANGUNJIWO', 16, 1, 1, '7452822', 'smkmuhbangunjiwo@yahoo.co.id', 'facebook.com/sm', '-', '-', 'KTSP', 'Unggul, Mandiri, Islami dan mampu bersaing di Era Global.', '1. Menyelenggarakan KBM sesuai KTSP dengan kemasan yang aktif, inovatif, kreatif, efektif dan menyenangkan.', '1. Tujuan Pendidikan Sekolah Menengah Kejuruan (SMK) meningkatkan kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta ketrampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut sesuai dengan kejuruannya.', 'UMI (Unggul, Mandiri, Islami)', '-78,357', '1,103,053', '2100', '3'),
(21, 'MA', 'Sekolah / Madrasah DIY', 20363262, 'd/w1/6/PP.006/1341/1', '0000-00-00', 'Jogodayoh Sumbermulyo Bambanglipuro Bantul', 'SUMBERMULYO', 8, 1, 1, '0274 6460484', 'maasysyifabantul@gmail.com', 'www.....', 'B', 'Ma.009252', 'KTSP dan K', 'A. Visi Madrasah\n\nMembentuk siswa berpribadi muslim yang  unggul sebagai calon kader persyarikatan Muhammadiyah dan Bangsa\n\n', 'B. Misi Madrasah\n1. Mewujuddkan peserta didik yang memiliki\na. Aqidah yang benar\nb. Akhlaqul karimah\nc. Kecerdasan intelektual, sosial, emosional dan religius\nd. Jiwa kemandirian\ne. Jasmani dan rohani yang sehat\nf. Jiwa kepemimpinan dan pendidik\n2. Mewujudkan peserta didik yang memiliki keunggulan dalam bidang\na. Tahfidzul qur an\nb. Bahasa Arab dan Bahasa Inggris\nc. Agribisnis\nd. ICT\ne. Olah raga bela diri dan Atletik\n3. Menyelenggarakan pendidikan dalam sitem Boarding school dengan memadukan kurikulum Muhammadiyah dengan kurikulum Kementerian Agama\n4. Mewujudkan peserta didik sebagai calon kader persyarikatan yang mampu meneruskan Matan Keyakinan dan Cita-cita Hidup Muhammadiyah.\n', 'C. Tujuan Madrasah\nTujuan madrasah sebagai bagian dari tujuan pendidikan nasional adalah meningkatkan kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.\nAdapun Tujuan Madrasah Aliyah Asy-Syifa  Muhammadiyah Bambanglipuro secara khusus :\na. Siswa hafal Al Quran  minimal 5 JUZ dan  memiliki  penguasaan  ilmu keislaman serta berakhlakul karimah \nb. Siswa memiliki bekal kemampuan untuk mengikuti pendidikan lebih lanjut.\nc. Mampu berpartisipasi aktif dalam kehidupan berbangsa dan bernegara yang demokratis.\nd. Meningkatkan peran dan fungsi MA A Asy-Syifa  Muhammadiyah sebagai pusat pembelajaran yang mencerahkan, mencerdaskan dan memberdayakan peserta didik\ne. Meningkatkan peran dan fungsi MA Asy-Syifa  sebagai pusat pembelajaran dan dakwah\nf. Mengembangkan model-model pendidikan al islam dan keMuhammadiyahan yang memberikan pencerahan faham islam dan komitmen gerakan Muhammadiyah.\ng. Meningkatkan dan memperkuat peran dan fungsi MA Asy-Syifa  Muhammadiyah sebagai pusat perkaderan dengan pembinaan IPM, HW, TS Putera Muhammadiyah Sebagai organisasi intra kurikuler yang bersifat wajib\nh. Memperkuat dan memperteguh identitas MA Asy-Syifa  Muhammadiyahdengan membangun filosofi pendidikan berdasarkan Al-Qur an da sunah\ni. Mengembangkan dan memperkuat kemandirian MA Asy-Syifa  Muhammadiyah melalui pengembangan dan optimalisasi pendidikan, partisipasi masyarakat, kerjasama berbagai pihak\nj. Mengembangkan kualitas kepemimpinan, tata kelola keuangan, pemanfaatan IT, penjaminan mutu dan berbagai aspek lain yang mendukung pengembangan keunggulan pendidikan Muhammadiyah\n\na) Menghasilkan lulusan mampu hafal surat-surat pendek pada juz amma, Asmaul Husna, tahlil, dapat Praktik Ibadah dan do''a sehari-hari.\nb) Menghasilkan lulusan mampu mengoperasionalkan Komputer dan mesin jahit.\nc) Menghasilkan lulusan mampu mengamalkan ucapan salam.\nd) Menghasilkan lulusan mampu dan fasih membaca Al-qur''an.\ne) Menghasilkan lulusan mampu dan fasih serta mengamalkan doa sehari-hari.\nf) Menghasilkan lulusan berakhlakul karimah\ng) Meningkatkan perolehan dana infaq.\nh) Meningkatakan kegiatan sholat dzuhur berjama ah.\ni) Meningkatkan pengamalan zakat fitrah.\n', '', '79,233,511,799', '11,032,310,381', '3000', '30'),
(22, 'MTS', 'MTsN GIRILOYO', 20411942, '83/024/B/T', '0000-00-00', 'Peleman', 'BANGUNJIWO', 16, 1, 1, '0274 6465098', 'mtskasihan@gmail.com', '', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'Pendidikan Berkualitas Menuju Insan Ceria (CERDAS, IMAN, BERAKHLAK', '1. Menyelenggarakan Pendidikan dengan memadukan kurikulum Departemen Agama-Departemen Pendidikan-Persyarikatan Muhammadiyah.\n2. Meningkatkan Kualitas pembelajaran dengan mengembangkan kecerdasan intelektual (IQ) kecerdasan emosional (EQ) dan kecerdasan Spiritual (SQ) \n3. Melaksanakan pengembangan kurikulum berbasis kompetens(KBK) dan kurikulum muatan lokal \n4. Menyelenggarakan Pendidikan keterampilan hidup\n5. Membudayakan taat beribadah, peduli lingkungan\n6. Membudayakan taat beribadah, peduli lingkungan \n', '1. Menyelenggarakan Pendidikan dengan memadukan kurikulum Departemen Agama-Departemen Pendidikan-Persyarikatan Muhammadiyah.', '', '110310788', '-78737619', '2200', '30'),
(23, 'SMA', 'SMA Muhammadiyah Bantul', 20400153, '067/BP/1964', '0000-00-00', 'JL. Urip Sumoharjo No. 4/ A Bantul', 'BANTUL', 11, 1, 1, '0274 367575', 'sma_muh_btl@yahoo.co.id', 'sma-muhiba.sch.', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'visi misi sekolah SMA Muhammadiyah  Bantul adalah Terwujudnya Peserta Didik yang Berprestasi dan Berkepribadian Islami', '1. Mewujudkan sekolah yang tertib dengan slogan 5 T ( tertib masuk, tertib berpakaian, tertib KBM, tertib ibadah, dan tertib administrasi ). 2. Melaksanakan pembelajaran yang islami, kreatif, dan inovatif. 3. Membentuk kader Muhammadiyah yang tangguh. 4. Melaksanakan 7 K ( keamanan, kebersihan, ketertiban, keindahan, kekeluargaan, kerindangan, ketaqwaan ). 5. Mengembangkan potensi siswa dalam bidang akademik, seni dan olahraga. 6. Melaksanakan pendidikan Life Skill. 7. Mewujudkan sekolah bebas rokok dan narkoba', '1. Terwujudnya sekolah yang tertib dengan slogan 5 T ( tertib masuk, tertib KBM, tertin Ibadah dan Tertib Administrasi). 2. Terselenggaranya pembelajaran yang islami, kreatif, dan inovatif. 3. Terbentuknya kader Muhammadiyah yang tangguh. 4. Terwujudnya 7 K ( keaamanan, kebersihan, ketertiban, keindahan, kekeluargaan, kerindangan, ketaqwaan ). 5. Terwujudnya peserta didik yang berprestasi di bidang akademik, seni dan olahraga. 6. Terwujudnya peserta didik yang mempunyai kecakapan hidup ( life skill ). 7. Terwujudnya sekolah bebas rokok dan narkoba', '', '-79,023', '1,103,491', '15000', '30'),
(24, 'SMA', 'SMA Muhammadiya Kreten', 20400282, '3658/II.157/DIY-79/1', '0000-00-00', 'KERTEN', '', 4, 1, 1, '85100994057', 'smukerim@yahoo.com', 'www.....', 'A', 'Ma.001892', 'KTSP ', 'SMA Muhammadiyah Imogiri Beriman dan Bertaqwa, Cerdas, Handal dan Percaya Diri', 'a.Â Â Â Â Â Â Â Â  Membentuk pribadi muslim yang bertaqwa untuk mewujudkan kehidupan sekolah yang kondusif dan islami, b.Â Â Â Â Â Â Â Â  Melaksanakan kegiatan belajar mengajar secara efektif dan efisien, dinamis dan menyenangkan, c.Â Â Â Â Â Â Â Â  Menyelenggarakan pembelajaran yang menumbuh kembangkan kemampuan berpikir kritis, kreatif dan aktif dalam memecahkan masalah.,  d.Â Â Â Â Â Â Â  Meningkatkan profesionalisme pendidik dan tenaga kependidikan, e. Meningkatkan kompetensi peserta didik di bidang akademik dan ketrampilan hidup melalui kegiatan ekstra kurikuler, menambah waktu pembelajaran dan praktek keterampilan', 'a.Â Â Â Â Â Â  Terwujudnya manusia muslim yang ber-Taqwa kepada Allah SWT melalui proses pembelajaran dalam suasana yang kondusif, b.Â Â Â Â Â  Tercapainya hasil kelulusan 100%, c.Â Â Â Â Â Â  Terwujudnya pendidik dan tenaga kependidikan yang profesional dalam melaksanakan tugas,  d.Â Â Â Â Â  Tercapainya 20% jumlah lulusan yang melanjutkan ke Perguruan Tinggi baik melalui jalur undangan maupun ujian tulis, e.Â Â Â Â Â Â  Tercapainya predikat juara dalam lomba keagamaan, olah raga dan seni tingkat provinsi, f.Â Â Â Â Â Â  Terserapnya 80% alumni di berbagai lapangan pekerjaaan,  g.Â Â Â Â Â  Tercapainya peningkatan nilai rata-rata UN: 0,5 tiap mata pelajaran (dari hasil UN tahun sebelumnya)  dengan mengoptimalkan bimbingan belajar efektif, h.Â Â Â Â Â  Meningkatnya kompetensi peserta didik dalam bidang ketrampilan hidup.', 'SMUHIM "BERCAHAYA"', '-79,136', '1,103,849', '1300', '0'),
(25, 'SMA', 'SMA Muhammadiyah Piyungan', 20400399, '3657/II.156/DIY-79/1', '0000-00-00', 'PIYUNGAN SRIMARTANI PIYUNGAN', 'SRIMARTANI', 14, 1, 1, '0274 -', 'smamuhpiyungan@yahoo.com', 'www.....', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP 2006', 'visi misi sekolah SMA Muhammadiyah Piyungan adalah membentuk manusia Ceria Cerdas, Religius, Inovatif dan Andal', '1. Melaksanakan pembelajaran terintegrasi dengan pendidikan kecakapan hidup, 2. membentuk aklakaqul karimah  menjadi tabiat siswa sehari hari,3.melaksanakan pembelajaran pendidikan agama  secara efektif, 4. mengembangkan kreatifitas siswa, 5. menerapkan pembelajaran aktif, inovatif, kreatif, efisien dan menyenangkan.', '1.Terbentuknya kepribadian Islami  yang beraklaqul kharimah, 2.Peserta didik membudayakan senyum, salam, sapa, santun, dengan siapapun di lingkungan sekolah,3.Terbekalinya peserta didik dengan ilmu pengetahuan agar mampu melanjutkan ke jenjang pendidikan  lebih tinggi,4. Terciptanya suasana pembelajaran yang aktif, inovatif, kreatif, efektif yang menyenangkan, 5. tertanamnya sikap ulet, gigih dan tekun dalam belajar.', 'CERIA', '-78,312', '1,104,754', '1200', '30'),
(26, 'SMA', 'SMA Muhammadiyah Pleret', 20400398, '82/ I.13.1 / I.86', '0000-00-00', 'Kanggotan, RT02/Rw05, Pleret, Pleret, Bantul, 5579', 'PLERET', 6, 1, 1, '0274 4415024', 'smamuhpleret@yahoo.com', 'www.....', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Terwujudnya insan muslim yang Beriman dan Bertaqwa , Cersad, Terampil, Mandiri, dan Berbudaya', '1. Menanamkan nilai-nilai Islami dalam kehidupan sehari-hari, 2. Meningkatkan prestasi peserta didik dibidang akademik dan non akademik, 3. Mengembangkan minat , bakat dan ketrampilan untuk hidup mandiri, 4. Mengembangkan kultur sekolah yang kondusif dan Islami', '1. Membentuk generasi muslim yang beriman dan bertaqwa, berakhlak mulia serta memiliki kemauan dan kemampuan untuk mengembangkan diri sesuai dengan ajaran agama Islam, 2. Menghasilkan lulusan peserta didik dengan nilai rata-rata ujian akhir di atas batas minimal kelulusan, 3. Mampu menciptakan prestasi di berbagai lomba olimpiade sains, keagamaan, kesenian, olahraga dan kesehatan, 4. Mengoptimalkan pelaksanaan KBM secara rutin, menegakkan kedisiplinan dan tata tertip serta rasa kekeluargaan warga sekolah dengan penuh tanggungjawab.', '', '-78,681', '1,103,974', '1300', '10'),
(27, 'SMA', 'SMA Muhammadiyah Bangunharjo', 20400397, '16/I.13.1/I.86', '0000-00-00', 'JL. Imogiri Barat Km 7', 'BANGUNHARJO', 12, 1, 1, '0274 4396249', 'sma.museba@yahoo.co.id', '', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP ', 'Visi SMA Muhammadiyah Sewon adalah mewujudkan peserta didik yang berakhlakul karimah, cakap dan kreatif.', '1. Melaksanakan pembelajaran Pendidikan Agama secara efektif yang menekankan pada aspek amaliah di sekolah, di rumah dan di masyarakat. 2. Menumbuhkan semangat keunggulan secara intensif seluruh warga sekolah ( disiplin, ketauladan dan tanggungjawab). 3. Melaksanakan pembelajaran terintegrasi dengan pendidikan kecakapan hidup. 4. Menumbuhkan, mendorong dan mengembangkan kreatifitas peserta didik. 5. Menerapkan manajemen partisipasif semua warga sekolah dengan melibatkan seluruh warga sekolah.', '1. Membentuk kepribadian Islami yang berakhlaqul karimah dengan tertib ibadah sehingga memiliki  kecerdasan emosional, spiritual dan sosial. 2. Membekali peserta didik dengan ilmu pengetahuan agar mampu melanjutkan ke jenjang pendidikan yang lebih tinggi. 3. Menciptakan suasana pembelajaran yang aktif, inovatif, kreatif, efektif dan menyenangkan. 4. Menanamkan sikap ulet, gigih, tekun belajar dan mandiri agar mampu terjun di masyarakat dengan baik. 5. Membentuk kepribadian peserta didik untuk mengembangkan potensi dirinya.', '', '-78,557', '1,103,708', '2300', '2'),
(28, 'SMP', 'SMP NEGERI 4 SEWON', 20400412, '058/H/1986', '0000-00-00', 'BEKANG', 'MULYODADI', 8, 1, 1, '85101335964', 'smpmuh1bambanglipuro@gmail.com', 'www.smpmuh1-bam', 'A', '10.01/BAP-SM/TU/IX/2012', 'KTSP dan K', 'Bertaqwa, Berprestasi, Trampil dan Berbudaya', '', '1.............2.................3...........', '', '-79,023', '1,103,491', '7700', '30'),
(29, 'SMP', 'SMP NEGERI 1 SRANDAKAN', 20400312, 'PIMPINAN PUSAT MUHAM', '0000-00-00', 'DERMAN', 'SUMBERMULYO', 8, 1, 1, '2742810135', 'smpmudabali@gmail.com', 'www.....', 'B', '10/01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'MENJADIKAN SEKOLAH UNGGUL DALAM PENGEMBA NGAN AKHLAK MULIA,KECERDASAN DAN KETERAMPILAN', '1.MENDIDIK MENGAJAR&MELATIH MEMBACAAL QUR''AN  2.MENDIDIK ,MENGAJAR &MEMBIBING SHOLAT WAJIB DAN SUNAT 3.MENANAMKAN DAN TELADAN AHLAKUL KARIMAH  4MENYELENGGARAKAN KBM PRINSIP PAIKEM 5.MENGUPAYAKAN PRESTASI BELAJAR YANG OPTIMAL 6.MENINGKATKAN PRESTASI SISWA DALAM BERBAGAI LOMBA TINGKAT KABUPATEN /PROPINSI 7.MEMBERIKAN BEKAL KETRAMPILAN KECAKAPAN HIDUP 8.MENDIDIK DAN BERORGANISASI 9.MEMBINA KADER ORGANISASI', '1.............2.................3...........', '', '-79.302', '110.3302\n', '2200', '30'),
