(31, 'SMK', 'Sekolah / Madrasah DIY', 20400311, '3686/II.185/DIY.79/7', '0000-00-00', 'Seropan Muntuk Dlingo Bantul', 'MUNTUK', 5, 1, 1, '85328007443', 'smpmuhadlingo@gmail.com', '0', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'visi sekolah SMP Muhammadiyah 2 Dlingo adalah Mewujudkan manusia muslim yang beriman, taqwa, cerdas, terampil, berakhlak mulia dan percaya diri dalam rangka mempersiapkan kader bangsa', '1 Menyelenggarakan proses pembelajaran yang efektif, 2. Menciptakan iklim kondusif di sekolah 3.Memberikan modal keterampilan bagi lulusan, 4. Memberikan layanan bagi siswa seoptimal mungkin', '1.............2.................3...........', '', '-79,023', '1,103,491', '900', '30'),
(32, 'SMP', 'SMP Negeri 1 Pundong', 20400307, '2970/M.605/DIY.65/77', '0000-00-00', 'JL. RAYA IMOGIRI POS IMOGIRI 55782', 'IMOGIRI', 4, 1, 1, '85101994024', 'smp.muhim@ymail.com', 'smpmuhimogiri.c', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP dan K', 'BERTAKWA, CERDAS, TERAMPIL DAN KOMPETITIF', '1. Mewujudkan peningkatan ketakwaan dan pengamalannya, 2. Mewujudkan mutu lulusan yang mampu berkiprah dalam lingkungan masyarakat, 3. Mewujurkan keunggulan dalam prestasi akademik dan non akademik, 4. Mewujudkan kelengkapan perangkat kurikulum dan pengembangannya, 5. Mewujudkan kualitas sistem pembelajaran sesuai SNP, 6. Mewujudkan pendidik dan tenaga kependidikan yang berkualitas, 7. Mewujudkan kelengkapan sarana dan prasarana pendidikan, 8. Mewujudkan pelaksanaan manajemen berbasis sekolah, 9. Mewujudkan penggalangan pembiayaan, pendidikan dari berbagai sumber, 10. Mewujudkan kualitas sistem penilaian sesuai SNP, 11. Mewujudkan lingkungan yang memotivasi dan mendukung pembelajaran.', '1. Mewujudkan peserta didik yang bertakwa, berakhlak mulia, cerdas, terampil,percaya diri, cinta tanah air, berguna bagi masyarakat, negara dan mampu beramal menuju terwujudnyamasyarakat utama adil dan makmur yang diridhai  Allah SWT. 2. Meningkatkan kemampuan peserta didik baik bidang akademik maupun non akademik. 3. Menghasilkan lulusan yang berkualitas dan mampu bersaing. 4. Mewujudkan SMP Muhammadiyah Imogiri sebagai sekolah unggulan.', '', '-79,209', '1,103,821', '15800', '2'),
