(34, 'SMP', 'SMP NEGERI 1 PLERET', 20400305, '55092/D/I/1977', '0000-00-00', 'Jln Ring Road Selatan, Senggotan', 'TIRTONIRMOLO', 16, 1, 1, '0274 380443', 'smphamka@gmail.com', '', 'B', 'no sk akreditasi', 'KTSP dan K', 'Rokhmatan Lil ''alamin dibidang Pendidikan', '1.................., 2.........................3...............', '1.............2.................3...........', '', '-78,254', '1,103,495', '5000', '1'),
(35, 'SMP', 'SMP NASIONAL BANTUL', 20400324, '2969/M.604/DIY.64/77', '0164-08-01', 'Blali', 'SELOHARJO', 3, 1, 1, '', 'smpm1pdg@yahoo.com', '', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Visi SMP Muhammadiyah 1 Pundong adalah Membentuk sumber daya manusia yang unggul, bertaqwa, breakhlak mulia, cerdas, terampil dan berdisiplin.', '1. Mewujudkan lulusan dengan kemampuan akademik tinggi, bisa berpikir cepat dan dapat mengatasi berbagai persoalan yang dihadapinya; 2. Mewujudkan lulusan yang memiliki wawasan kebangsaan yang tinggi dan cinta tanah air; 3. Mewujudkan nilai-nilai solidaritas bagi kehidupan sekolah; 4. Mewujudkan lulusan yang taat beribadah, mengamalkan ajaran agamanya, dan selalu melakukan amar ma`ruf nahi munkar; 5. Mewujudkan kemampuan olahraga yang tangguh dan kompetitif; 6. Mewujudkan kemampuan yang tangguh dan kompetitif; 7. Mewujudkan kemampuan HW yang menjadi suri tauladan; 8. Mewujudkan sekolah progresif, inovatif dan visioner; 9. Mewujudkan organisasi sekolah yang terus belajar (school that learns);10. Mewujudkan fasilitas sekolah yang memadai, fungsional, relevan, mutakhir, dan berwawasan kedepan; 11.Mewujudkan pendidik dan tenaga kependidikan yang profesional, memiliki komitmen dan dedikasi tinggi; 12. Mewujudkan manajemen berbasis sekolah yang tangguh; 13. Mewujudkan pembiayaan pendidikan yang memadai, wajar dan adil; 14. Mewujudkan kebiasaan menghargai prestasi; 15. Mewujudkan kebiasaan tertib dalam beribadah; 16. Mewujudkan kebiasaan pengamalan ajaran agama; 17. Mewujudkan kehidupan sekolah yang harmonis dan agamis; 18. Mewujudkan sekolah sebagai wiyata mandala yang menjadi surga bagi warganya (madrosati jannati); 19. Mewujudkan sekolah sehat, tertib, ramah dan penuh dengan sopan santun; 20. Mewujudkan lingkungan sekolah yang nyaman, aman, rindang, asri, dan bersih.', '1. Sekolah mampu menghasilkan lulusan dengan capaian rata-rata NUN 76; 2. Terciptanya sikap mental peserta didik yang mampu melaksanakan, mengamalkan ibadah dengan tertib dan membaca Al Quran dengan baik dan lancar; 3. Terciptanya mental dan karakter peserta didik yang dapat menjadi contoh dalam masyarakat; 4. Terciptnya peserta didik yang memiliki kemampuan akademik, teknologi, dan seni budaya; 5. Sekolah mampu menghasilkan lulusan yang berpartisipasi aktif dalam kehidupan bernegara; 6.Sekolah mampu menghasilkan lulusan yang taat beribadah; 7. Sekolah mampu menghasilkan lulusan yang selalu mengamalkan ajaran agamanya dalam kehidupan sehari-hari; 8. Sekolah mampu menghasilkan lulusan yang gemar melakukan `amar ma`ruf nahi munkar;9. Sekolah mamu membentuk tim olahraga dan atlet yang memenangi lomba kabupaten dan provinsi; 10. Sekolah mampu membentuk kepanduan HW yang aktif berpartisipasi dalam kegiatan sosial dan kepanduan; 11. Sekolah mampu menghasilkan lulusan yang berperilaku baik dalam kehidupan bermasyarakat; 12. Sekolah mampu memenuhi proses persekolahan yang terencana, terorganisir, terlaksana, terkontrol, dan terevaluasi dengan baik; 13. Sekolah mampu memenuhi kebutuhan fasilitas sekolah yang memadai, fungsional, relevan, mutakhir, dan berwawasan kedepan; 14. Sekolah mampu memenuhi ketersediaan pendidik dan tenaga kependidikan yang profesional, memiliki komitmen dan dedikasi tinggi; 15. Sekolah mampu memenuhi ketersediaan pendidik dan tenaga kependidikan yang tangguh, ulet dan mampu memberikan solusi atas berbagai persoalan sekolah secara konstruktif; 16. Sekolah mampu menghasilkan menerapkan manajemen berbasis sekolah yang tangguh; 17. Sekolah mampu melakukan proses penilaian pendidikan yang tepat, menyeluruh, dan adil dengan melibatkan guru, sekolah dan pemerintah; 18. Sekolah mampu menyediakan pembiayaan pendidikan yang memadai, wajar dan adil; 19. Sekolah mampu mewujudkan kebiasaan tertib dalam beribadah; 20. Sekolah mampu mewujudkan kebiasaan pengamalan ajaran agama; 21. Sekolah mampu mewujudkan kehidupan sekolah yang harmonis dan agamis; 22. Sekolah mampu mewujudkan sekolah sebagai wiyata mandala yang menjadi surga bagi wargany (mad`roti jannati); 23. Sekolah mampu mewujudkan sekolah sehat, tertib, ramah dan penuh dengan sopan santun; 24. Sekolah mampu mewujudkan lingkungan sekolah yang nyaman, aman, rindang, asri dan bersih.', '', '-79,465', '110.363', '5000', ''),
