(37, 'SMP', 'SMP 1 IMOGIRI', 20400322, '0748/H/1986', '0000-00-00', 'JL. Bantul km 8,5 Bandung', 'PENDOWOHARJO', 12, 1, 1, '0274 (6466282)', 'smpmuhammadiyahsewon86@gmail.c', 'www.smpmuhsewon', 'A', '01/BAP-SM/TU/X/2014', 'KTSP dan K', ' PASTI  Unggul dalam prestasi, Berakhlak Mulia, Siap, Bertaqwa, Inovatif', '1. Melaksanakan PBM yang bermutu dan berbasis TIK; 2. Meningkatkan prestasi akademik dan nonakademik; 3. Melaksanakan peningkatan akhlak mulia; 4. Meningkatkan nilai ujian nasional; 5. Meningkatkan keterampilan; 6. Melaksanakan pengkaderan pesyarikatan dan bangsa;Â  7. Melaksanakan peningkatan Iman dan Taqwa (Imtaq); 8. Melaksanakan peningkatan inovatif dan kreatif; 9. Meningkatkan kualifikasi dan profesional pendidik dan tenaga kependidikan; 10. Meningkatkan pemenuhan SPM; 11. Meningkatkan pelaksanaan MBS.', '1. Seluruh guru dapat melaksanakan PBM yang bermutu dan berbasis TIK sehingga siswa unggul dalam prestasi akademik; 2. Sekolah dapat melaksanakan pengembangan bakat/potensi dan minat yang dimiliki siswa melalui kegiatan ekstrakurikuler sehingga siswa unggul dalam prestasi nonakademik; 3. Seluruh siswa menjadi insan yang berakhlak mulia; 4. Seluruh siswa kelas IX dapat mencapai nilai ujian nasional yang maksimal sehingga siap untuk melanjutkan pendidikan ke jenjang berikutnya; 5. Seluruh siswa memiliki keterampilan yang memadai sehingga siap untuk bekal bekerja jika tidak bisa melanjutkan pendidikan pada jenjang berikutnya; 6. Seluruh siswa siap menjadi kader persyarikatan dan bangsa; 7. Seluruh siswa menjadi insan yang beriman dan bertaqwa kepada Alloh SWT; 8. Seluruh siswa  menjadi manusia yang inovatif dan kreatif; 9. Seluruh pendidik dan tenaga kependidikan memenuhi standar kualifikasi dan profesionalitas; 10. Sekolah dapat memenuhi SPM; 11. Sekolah dapat melaksanakan MBS.', 'Berdispiplin, Berilmu, Berkemajuan', '-7,864', '1.103.421', '2200', ''),
