(40, 'MA', 'MA Darul Ulum Muhammadiyah Galur', 20411881, '3670/II.169/DIY.32/7', '0000-00-00', 'Sewugalur', 'KARANGSEWU', 50, 3, 1, '6290000000000.0', 'madumuhgalur@yahoo.co.id', 'http://madu-muh', 'A', 'Ma.026776', 'KTSP dan K', 'visi MA Darul Ulum Muhammadiyah Galur adalah Terwujudnya Generasi Islami yang Cerdas, Terampil dan Mandiri (Geni CTM).', '1. Memberikan pelayanan pendidikan yang Islami; 2. Membina generasi muda agar memiliki sense of social; 3. Menyediakan fasilitas yang memadai; 4. Menyelenggarakan pendidikan dan keterampilan.', '1. Mencapai tujuan pendidikan Muhammadiyah yaitu mewujudkan manusia muslim yang bertaqwa, berakhlak mulia, cakap, percaya diri sendiri, cinta tanah air dan berguna bagi masyarakat dan negara, beramal menuju terwujudnya masyarakat utama dan makmur yang diridhoi Allah Subhanahu wa ta ala; 2. Mewujudkan dan mengembangkan ilmu pengetahuan dan keterampilan untuk kemajuan umat dalam pembangunan masyarakat, bangsa dan negara; 3. Bersama pemerintah memajukan penyelenggaraan pendidikan dan kebudayaan sesuai dengan Undang-undang 1945 pasal 31; 4. Membentuk calon kader persyarikatan Muhammadiyah; 5. Menyiapkan calon  ulama, zu ama dan muballigh yang mandiri berlandaskan al-Quran dan Sunnah; 6. Menjadi teladan bagi masyarakat lingkungan sekolah khususnya dan masyarakat kecamatan Galur pada umumnya.', 'Ikhlas bekerja dan beramal.', '-79.435.483', '1.102.083.333', '2200', '500'),
(41, 'MTS', 'MTs NEGERI LAB UIN YOGYAKARTA', 20411922, '77/4/C/T', '0000-00-00', 'Sewugalur', 'KARANGSEWU', 50, 3, 1, '8112555672', 'mts_du@yahoo.com//mtsdu1932@gm', 'mts-du.mysch.id', 'A', '21.01/BAP-SM/TU/XII/2013', 'Kurikulum ', ' UNGGUL DALAM MUTU, BERPIJAK PADA IMAN DAN TAKWA', ' DISIPLIN  DALAM  KERJA, MEWUJUDKAN MANAJEMEN KEKELUARGAAN, KERJASAMA, PELAYANAN PRIMA DENGAN MENINGKATKAN SILATURAHIM', 'Tujuan pendidikan dasar adalah meletakkan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.', 'Madrasah Unggul Berkarakter.', '110,207,545', '7,943,318', '5000', '2 Mbps'),
