(44, 'SMA ', 'SMA Muhammadiyah Al- Manar', 20402801, '3651/II.151/DIY.78/7', '0000-00-00', 'Brosot Galur Kulon Progo Kode Pos 55661 Yogyakarta', 'BROSOT', 50, 3, 1, '8175425649', 'smam.almanar.bs@gmail.com', 'www& ..', 'B', '22.01/BAP.SM/TU/X/2015', 'KTSP dan K', 'Terwujudnya peserta didik yang unggul dalam prestasi, berbudaya dan berwawasan masa depan serta berakhlak mulia.', 'Mengembangkan sumber daya secara oktimal dalam rangka mempersiapkan siswa di era global.', 'Menghasilkan lulusan yang cerdas, berpengetahuan luas, berkepribadian, berakhlak mulia, serta berketrampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.', '', '-79,023', '1,103,491', '15000', ''),
(45, 'SMA', 'SMA Muhammadiyah Wates', 20402800, '3650/II.149/DIY.78/7', '0000-00-00', 'JL. Kedunggong Wates,Wates,Kulon Progo', 'WATES', 60, 3, 1, '0274 774646', 'smamuhwateskp@yahoo.co.id', 'www.smamuhwates', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP ', 'visi sekolah SMA Muhammadiyah Wates adalah Terdidik,Tangguh,Ilmiah,Islami dan Berbudaya', '1.Meningkatkan mutu lulusan yang berwawasan global,2. Menumbuhkan semangat keunggulan dan mampu bersaing,3.Membentuk kader Muhammadiyah yang militan dan intelek,4.Menumbuhkembangkan sikap ilmiah,5.Membiasakan hidup secara alami,6.Menjadi teladan dimanapun berada,7.Mengembangkan jatidiri peserta didik sesuai minat,bakat dan potensinya,8.Menghargai,Melestarikan,dan mengembangkan budaya bangsa.', '1. Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya,2.Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien,3.Menggalakan 3 Tertib yaitu Tertib Waktu,Tertib Administrasi,TertibKerja,Belajar dan Beribadah,4.Membekali peserta didik dengan ilmu penetahuan dan teknologi,5.Membekali peserta didik dengan ketrampilan hidup,6.Memberi kesempatan berorganisasi dan kegiatan-kegiatan positif untuk membentuk karakter,7.Mampu menjuarai bidang akademis maupun non akademis minimal tingkat kabupaten,8. Membiasakn bertindak dan bekerja secara ilmiah,9.Menumbuhkan penghayatan terhadap ajaran agama islam secara nyata dalam kehidupan sehari hari,10.Menciptakan kondisi lingkungan yang islami,11.Mengenakan,mendidik dan melatihaneka cabang olahraga dan kesenian yang adiluhung,11.Meningkatkan apresiasi terhadap budaya bangsa,12.Menigkatkan pemahaman wawasan global untuk mengahadapi masa depan.', '', '-78,683', '1,101,515', '5000', '30'),
(46, 'SMP', 'SMP MUHAMMADIYAH SEWON', 20402733, '3130/M-644/DIY-56/77', '0000-00-00', 'JL. SAYANGAN', 'BANJARARUM', 51, 3, 1, '8101509554', 'muh1ka@yahoo.co.id', 'www.smpmuh1kali', 'A', 'no sk akreditasi', 'KTSP', 'Terbentuknya manusia terdidik yang mandiri, terampil, berwawasan IMTAQ dan IPTEKS', '1. Meningkatkan pembelajaran berwawasan imtaq. 2. Mengefektifkan proses pembelajaran di kelas dan di luar kelas. 3. Melaksanakan kegiatan kompetisi akademik dan non akademik. 4. Meningkatkan standar kelulusan secara bertahap. 5. Meningkatkan profesionalisme guru dan tenaga kependidikan. 6. Meningkatkan kualitas ketrampilan hidup/ Life skill / berwirausaha. 7. Melengkapi sarana dan prasarana sekolah sesuai dengan SNP. 8. Mengembangkan pembelajaran berbasis ipteks. 9. Memantapkan pelaksanaan program manajemen berbasis sekolah (MBS). 10. Mengembangkan budaya bersih sehingga menumbuhkan kesadaran arti pentingnya kebersihan lingkungan (7K).', '1. Sekolah mampu meningkatkan kalitas standar kelulusan. 2. Sekolah mampu meningkatkan kualitas kegiatan non akademik. 3. Sekolah mampu meningkatkan kepercayaan masyarakat. 4. Sekolah mampu menghasilkan Kurikulum yang memenuhi standar. 5. Sekolah mampu menghasilkan silabus RPP semua mata pelajaran. 6. Sekolah mampu menerapkan pembelajaran saintifik. 7. Sekolah memiliki tenaga pendidik dan kependidikan yang handal. 8. Sekolah memiliki sarana yang lengkap. 9. Sekolah mampu membudayakan perilaku yang mencerminkan kecintaan terhadap lingkungan hidup. 11. Sekolah mampu membudayakan perilaku yang mencerminkan ketakwaan terhadap Tuhan YME. 12. Sekolah mampu membudayakan pembiasaan 7 S.', '', '-7,716,993', '110,225,935', '4500', ''),
(47, 'SMP', 'SMP Muhammadiyah 2 Kalibawang', 20402722, '0277/H/1986', '0000-00-00', 'Duwet', 'BANJARHARJO', 51, 3, 1, '6290000000000.0', 'smpmuhaklbw@yahoo.co.id', 'www.....', 'B', 'Dp.018563', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Kalibawang adalah Unggul dalam Imtaq dan Prestasi', 'Menumbuhkan penghayatan terhadap pengamalan agama yang dianut.', '1.Â Â Â Â Â Â  Sekolah memiliki Kurikulum Tingkat Satuan Pendidikan sebagai pedoman pelaksanaan pembelajaran.', 'Hari Ini harus lebih baik dari kemarin.', '-76,934', '1,102,604', '1300', '');
