(86, 'SMP', 'SMP MUHAMMADIYAH 1 TEPUS', 20407352, '169/J.VE.29/KPPNGP/7', '0000-00-00', 'Puleireng, Sioharjo, Tepus', 'SIDOHARJO', 34, 2, 1, '-', 'smpmuhammadiyahtepus@yahoo.com', '-', 'B', '11940', 'KTSP', '  UNGGUL DALAM PRESTASI, BERKEPRIBADIAN, BERPIJAK PADA IMAN DAN TAKWA', '1. Meningkatkan mutu akademik.', '1. a. Memiliki kwalitas iman dan taqwa yang ditandai dengan kemampuan membaca Al-Qur an, akhlaqul karimah dan ketentuan dalam beribadah serta memiliki wawasan ke-Islaman yang lebih baik.,', '', '-81,052', '110,631', '900', '0'),
