(121, 'SMK', 'SMK Muhammadiyah Sumber Rejo', 20401175, '0617/I.13/MN/Kpts/19', '0000-00-00', 'Jl. D. Ronggowarsito No. 2 Medari Caturharjo Slema', 'CATURHARJO', 75, 4, 1, '274868419', 'stemuro@ymail.com', '', 'A', '22.01/BAP-SM/TU/X/2015', '2013', 'Menjadikan lulusan yang bertaqwa, cerdas, terampil, mandiri dan berbudaya dalam menghadapi tantangan global', 'Melaksanakan pendidikan dan pengajaran secara efektif, efesien serta inovatif; Meningkatkan kompetensi peserta didik; Mendidik peserta didik agar punya jiwa wirausaha dan berbudaya; Mengembangkan potensi peserta didik secara profesional; Meningkatkan penghayatan dan pengamalan terhadap ajaran Muhammadiyah', 'Penyediaan fasilitas untuk pembelajaran Teknik Kendaraan Ringan dan Teknik Sepeda Motor; Mengusahakan dengan sepenuhnya pelaksanaan kurikulum Tingkat Satuan Pendidikan (KTSP) dan Kurikulum 2013; Memberdayakan seluruh komponen sekolah (stake holder) guna mendukung tercapainya peningkatan ketrampilan di bidang otomotif; Menyiapkan tamatan yang mampu mengembangkan diri secara optimal dilandasi iman dan taqwa', '', '-7,682,293', '110,338,642', '9000', '10'),
